import React, { useState } from 'react'

const Lobby = () => {
  const [message, setMessage] = useState('')
  return (
    <div>
      <h1>Lobby</h1>
      <input onChange={() => setMessage(message)}></input>
    </div>
  )
}

export default Lobby
